  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR and Izembek Bay Area outlines Refuge accomplishments from January through April
  of 1958. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, and furbearers- is also covered. The Refuge development and maintenance
  section discusses physical developments. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors, hunting, and fishing.\",\n\t\"license_title\": \"License
